import React from 'react';
import Button from "react-bootstrap/Button";

const UnderMenu = () => {
    return (
        <div className={"under-menu"}>
            <Button>Incoming</Button>
            <Button>Outgoing</Button>
        </div>
    );
};

export default UnderMenu;
